import React, { Component } from 'react';

class Navigation extends Component {
	render() {
		return (
			<div>
				<ul>
					<li>Home Page</li>
					<li>Search Tweets</li>
					<li>Random Tweets</li>
				</ul>
			</div>
		);
	}
}

export default Navigation;
